import React, { useState, useEffect } from "react";
import { Link, useParams } from "react-router-dom";
import axios from "axios";

const VaccinationView = () => {

    // let history = useHistory();
    const [vaccination, setVaccination] = useState({
              v_id: '',
             patient_id: '' ,
              vc_id: '', 
              vaccine_id:'', 
              doctor_id:'' , 
              time:'',
              date:'',
              result:'',
              reason:''
    });
  const { v_id } = useParams();
  useEffect(() => {
    loadVaccination();
  }, []);
  const loadVaccination = async () => {
    const res = await axios.get(`http://localhost:3001/vaccination/search/${v_id}`);
    setVaccination(res.data);
  };
  return (
    <div className="container py-4">
      <Link className="btn btn-primary" to="/VaccinationView">
        back 
      </Link>
      <h1 className="display-4">Vaccination Id: {vaccination.v_id}</h1>
      <hr />
      <ul className="list-group w-50">
        <li className="list-group-item">Patient_id: {vaccination.patient_id}</li>
        <li className="list-group-item">VaccinationCenter_id: {vaccination.vc_id}</li>
        <li className="list-group-item">Vaccine_id: {vaccination.vaccine_id}</li>
        <li className="list-group-item">doctor_id: {vaccination.doctor_id}</li>
        <li className="list-group-item">Time: {vaccination.time}</li>
        <li className="list-group-item">Date: {vaccination.date}</li>
        <li className="list-group-item">Result: {vaccination.result}</li>
        <li className="list-group-item">reason: {vaccination.reason}</li>
      </ul>
    </div>
  );
};

export default VaccinationView;
